const navLinks = [
  {
    path: "/dashboard",
    icon: "ri-apps-2-line",
    display: "Dashboard",
  },
  {
    path: "/newTask",
    icon: "ri-bar-chart-horizontal-line",
    display: "NewTask",
  },
  {
    path: "/ri-timer-flash-line",
    icon: "ri-timer-flash-line",
    display: "Sell Cars",
  },
  {
    path: "/settings",
    icon: "ri-settings-2-line",
    display: "Settings",
  },
];

export default navLinks;
